import CreditCard from "../components/CreditCard";
import Header from "../layout/Header";
import Footer from "../layout/Footer";
const CreditPage = () => {
  return (
    <div>
      <Header />
      <br />
      <CreditCard />
      <br />
      <br />
      <br />
      <Footer />
    </div>
  );
};

export default CreditPage;
